import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import RoutesList from './Routes';
import { BrowserRouter } from 'react-router-dom';
import Sidebar from './Common/SideBar';

ReactDOM.render(
  <React.StrictMode>
   <BrowserRouter>
   <Sidebar />
       <RoutesList />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
